import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router><Menu/><Switch><Route path='/categoria/:categoryId' exact><Categoria/></Route></Switch></Router>
    </div>
  );
}

export default App;
